service cloud.firestore {
  match /databases/{database}/documents {

    // --- HELPER FUNCTIONS ---

    // 1. Est-ce que l'utilisateur est connecté ?
    function isAuthenticated() {
      return request.auth != null;
    }

    // 2. "God Mode" Hardcodé : Cet email a TOUS les droits, quoi qu'il arrive.
    // Cela évite d'être bloqué si la base de données est vide ou corrompue.
    function isSuperAdmin() {
       return request.auth.token.email == 'ahme.sang@gmail.com';
    }

    // 3. Admin déclaré dans la DB
    function isDBAdmin() {
       return exists(/databases/$(database)/documents/users/$(request.auth.uid)) &&
              get(/databases/$(database)/documents/users/$(request.auth.uid)).data.role == 'admin';
    }

    // 4. Est-ce un Admin (Hardcodé OU DB) ?
    function isAdmin() {
      return isSuperAdmin() || isDBAdmin();
    }

    // 5. Est-ce que l'utilisateur modifie ses propres données ?
    function isOwner(userId) {
      return request.auth.uid == userId;
    }

    // --- RÈGLES PAR COLLECTION ---

    // USERS : Inscription et Gestion de Profil
    match /users/{userId} {
      // Lecture : Tout le monde (pour l'annuaire et le mercato)
      allow read: if isAuthenticated();

      // Écriture (Création/Modif) :
      // 1. Soit je suis le Super Admin
      // 2. Soit c'est MON propre compte (userId correspond à mon UID Auth)
      // 3. Soit je suis déjà Admin dans la DB
      allow create, update: if isAuthenticated() && (isOwner(userId) || isAdmin());

      // Suppression : Réservé aux admins
      allow delete: if isAdmin();
    }

    // AGENCIES : Cœur du jeu
    match /agencies/{agencyId} {
       // Lecture : Tout le monde
       allow read: if isAuthenticated();

       // Création / Suppression d'agence : Réservé aux admins
       allow create, delete: if isAdmin();

       // Mise à jour : OUVERTE À TOUS LES CONNECTÉS
       // C'est nécessaire pour que les étudiants puissent :
       // - Uploader un livrable (modifie l'objet week)
       // - Postuler (modifie mercatoRequests)
       // - Changer de statut connexion
       allow update: if isAuthenticated();
    }

    // WEEKS : Planning global
    match /weeks/{weekId} {
       allow read: if isAuthenticated();
       // Seuls les admins touchent au calendrier structurel
       allow write: if isAdmin();
    }

    // Fallback de sécurité : Si on oublie une collection, seul l'admin y a accès
    match /{document=**} {
      allow read, write: if isAdmin();
    }
  }
}

