service cloud.firestore {
  match /databases/{database}/documents {

    // --- HELPER FUNCTIONS ---

    function isAuthenticated() {
      return request.auth != null;
    }

    // "God Mode" Hardcodé : Cet email a TOUS les droits.
    function isSuperAdmin() {
       return request.auth.token.email == 'ahme.sang@gmail.com';
    }

    // Admin déclaré dans la DB (Attention, peut échouer si user n'existe pas)
    function isDBAdmin() {
       return exists(/databases/$(database)/documents/users/$(request.auth.uid)) &&
              get(/databases/$(database)/documents/users/$(request.auth.uid)).data.role == 'admin';
    }

    function isAdmin() {
      return isSuperAdmin() || isDBAdmin();
    }

    // --- RÈGLES PAR COLLECTION ---

    // USERS : C'est ici que ça bloquait
    match /users/{userId} {
      allow read: if isAuthenticated();

      // CRITIQUE : Autoriser EXPLICITEMENT la création si c'est mon propre ID.
      // On ne vérifie PAS "isAdmin" ici, car l'utilisateur n'existe pas encore !
      allow create: if isAuthenticated() && request.auth.uid == userId;

      // UPDATE : Là on peut vérifier les rôles (car l'utilisateur existe déjà)
      // Soit c'est moi, soit c'est un admin (qui veut changer mon rôle par exemple)
      allow update: if isAuthenticated() && (request.auth.uid == userId || isAdmin());

      allow delete: if isAdmin();
    }

    // AGENCIES : Ouvert pour le gameplay
    match /agencies/{agencyId} {
       allow read: if isAuthenticated();
       allow create, delete: if isAdmin();
       // Tout le monde peut mettre à jour (Upload, Join, Leave, etc.)
       allow update: if isAuthenticated();
    }

    // WEEKS : Lecture seule sauf Admin
    match /weeks/{weekId} {
       allow read: if isAuthenticated();
       allow write: if isAdmin();
    }

    // FALLBACK
    match /{document=**} {
      allow read, write: if isAdmin();
    }
  }
}

